var nameArray = [
	'Apple Symbols',
	'Arial Rounded MT Bold',
	'Avenir Next Demi Bold',
	'Avenir Next Medium',
	'Avenir Next',
	'Courier New',
	'Courier New',
	'Wingdings 3',
	'Zapf Dingbats'
];

var dataArray = [
	'',
	'',
	'',
	'',
	'',
	'',
	'',
	'',
	''
];

var fontStretch = ['', '', '', '', '', '', '', '', ''];

var fontWeight = [
	'normal',
	'normal',
	'600',
	'500',
	'normal',
	'bold',
	'normal',
	'normal',
	'normal'
];

var fontStyleSubArray0 = ['normal'];

var fontStyleSubArray1 = ['normal'];

var fontStyleSubArray2 = ['normal'];

var fontStyleSubArray3 = ['normal'];

var fontStyleSubArray4 = ['normal'];

var fontStyleSubArray5 = ['normal'];

var fontStyleSubArray6 = ['normal'];

var fontStyleSubArray7 = ['normal'];

var fontStyleSubArray8 = ['normal'];

var fontStyle = [
	fontStyleSubArray0,
	fontStyleSubArray1,
	fontStyleSubArray2,
	fontStyleSubArray3,
	fontStyleSubArray4,
	fontStyleSubArray5,
	fontStyleSubArray6,
	fontStyleSubArray7,
	fontStyleSubArray8
];

function buildFontRule(
	fontFamily,
	fontData,
	fontStyle,
	fontWeight,
	fontStretch
) {
	if (fontStyle) {
		returnValue =
			'@font-face { font-family:"' +
			fontFamily +
			'"; font-style:' +
			fontStyle +
			';';
		if (fontWeight) {
			returnValue += 'font-weight:' + fontWeight + ';';
		}
		if (fontStretch) {
			returnValue += 'font-stretch:' + fontStretch + ';';
		}

		returnValue +=
			'src:url("data:font/opentype;base64,' + fontData + '"); }';
		return returnValue;
	} else {
		return '';
	}
}

for (var i in dataArray) {
	for (var j in fontStyle[i]) {
		const styleElement = document.createElement('style');
		styleElement.innerHTML = buildFontRule(
			nameArray[i],
			dataArray[i],
			fontStyle[i][j],
			fontWeight[i],
			fontStretch[i]
		);
		document.querySelector("head").appendChild(styleElement);
		// document.write("<style>" + buildFontRule(nameArray[i], dataArray[i], fontStyle[i][j], fontWeight[i], fontStretch[i]) + "</style>");
	}
}
